INSERT INTO `categories` VALUES (2,'أطفال','أطفال','ar','OuterWear','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/374\\/conversions\\/448760553_2412186705642573_8430230440751336225_n-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/374\\/448760553_2412186705642573_8430230440751336225_n.jpg\",\"id\":374}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/375\\/conversions\\/kids-banner-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/375\\/kids-banner.jpg\",\"id\":375}]','استمتع باختيار ملابس الأطفال التي تجمع بين الأناقة والراحة، حيث نقدم مجموعة مميزة من الأزياء التي تناسب جميع الأعمار. تمتاز تصاميمنا بالجودة العالية والاهتمام بالتفاصيل لتضمن لطفلك مظهرًا جذابًا وشعورًا مريحًا طوال اليوم. توفر تشكيلتنا كل ما يحتاجه طفلك من ملابس عملية وعصرية.',NULL,'2021-10-09 13:38:27','2024-08-22 08:57:48',NULL),(7,'مخاوير','مخاوير','ar','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/366\\/conversions\\/cat-makha-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/366\\/cat-makha.png\",\"id\":366}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/367\\/conversions\\/\\u0628\\u0627\\u0646\\u0631-\\u0645\\u062e\\u0627\\u0648\\u064a\\u0631-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/367\\/\\u0628\\u0627\\u0646\\u0631-\\u0645\\u062e\\u0627\\u0648\\u064a\\u0631.jpg\",\"id\":367}]','اكتشفي مجموعة المخاوير لدينا، حيث يتلاقى التراث مع التصميم العصري. كل قطعة مصنوعة لتعكس التراث الغني مع تبني الجماليات الحديثة. مثالية للمناسبات الخاصة والارتداء اليومي، تقدم المخاوير لدينا مزيجًا فريدًا من الراحة والأناقة والأناقة الثقافية.',8,'2021-10-09 13:40:33','2024-08-23 17:47:03',NULL),(8,'نساء','نساء','ar','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/376\\/conversions\\/cat-abaya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/376\\/cat-abaya.png\",\"id\":376}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/377\\/conversions\\/banner-abaya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/377\\/banner-abaya.jpg\",\"id\":377}]','فئة النساء في موقع WearSphere تقدم مجموعة واسعة من الأزياء العصرية والأنيقة التي تلبي احتياجات المرأة الخليجية. تشمل الفئة العديد من الخيارات التي تناسب جميع الأذواق، من العبايات التقليدية إلى الأزياء الحديثة والجذابة. نحرص على تقديم قطع عالية الجودة بأسعار تنافسية، مما يضمن للعملاء تجربة تسوق متميزة. اختاري من بين تشكيلة متنوعة تعكس الذوق الرفيع والأنوثة بأسلوب عصري يناسب جميع المناسبات.',NULL,'2021-10-09 13:40:47','2024-08-22 09:00:23',NULL),(11,'kids','sunglass-lSu','en','Shirts','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/378\\/conversions\\/cat-kids-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/378\\/cat-kids.png\",\"id\":378}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/379\\/conversions\\/kids-banner-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/379\\/kids-banner.jpg\",\"id\":379}]','Enjoy choosing children\'s clothing that combines elegance and comfort, as we offer a distinctive collection of fashions that suit all ages. Our designs are characterized by high quality and attention to detail to ensure that your child looks attractive and feels comfortable all day long. Our collection provides everything your child needs from practical and fashionable clothing.',NULL,'2024-07-08 13:53:25','2024-08-23 15:08:40',NULL),(12,'Men','sports-Tg0','en','Shirts','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/370\\/conversions\\/cat-men-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/370\\/cat-men.png\",\"id\":370}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/371\\/conversions\\/banner-men-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/371\\/banner-men.jpg\",\"id\":371}]','A wonderful serenity has taken possession of my entire soul, like these sweet mornings of spring which I enjoy with my whole heart. I am alone, and feel the charm of existence in this spot, which was created for the bliss of souls like mine.',NULL,'2024-07-08 13:53:31','2024-08-22 09:38:02',NULL),(13,'jalabya','sneakers-SPB','en','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/361\\/conversions\\/cat-gal-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/361\\/cat-gal.png\",\"id\":361}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/362\\/conversions\\/banner-jalabya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/362\\/banner-jalabya.jpg\",\"id\":362}]','Browse our collection of stylish jalabiyas, crafted for those who appreciate the fusion of tradition and contemporary fashion. Each piece is designed with attention to detail, offering comfort and elegance . our jalabiyas bring out the beauty in simplicity with a touch of modern design.',NULL,'2024-07-08 13:53:38','2024-08-20 18:30:10',NULL),(14,'عبايه','عبايه','ar','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/357\\/conversions\\/cat-abaya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/357\\/cat-abaya.png\",\"id\":357}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/359\\/conversions\\/banner-abaya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/359\\/banner-abaya.jpg\",\"id\":359}]','استكشفي مجموعتنا المختارة من العبايات المصممة خصيصًا للمرأة العصرية التي تقدر التقاليد والرقي. تمزج كل قطعة في مجموعتنا بين التصاميم الكلاسيكية للشرق الأوسط واللمسات المعاصرة، مما يوفر مجموعة متنوعة من الأنماط المثالية لأي مناسبة. تُصنع العبايات لدينا من أقمشة فاخرة، وتوفر الراحة والأناقة، مما يجعلها عنصرًا أساسيًا في خزانة ملابسك. سواء كنت تبحثين عن ملابس يومية أو شيء خاص، فإن WearSphere لديه العباية المثالية لتكمل أسلوبك الفريد.',8,'2024-08-20 17:48:25','2024-08-23 13:44:51',NULL),(15,'abaya','sneakers-spb-rc0-nDO','en','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/357\\/conversions\\/cat-abaya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/357\\/cat-abaya.png\",\"id\":357}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/358\\/conversions\\/banner-abaya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/358\\/banner-abaya.jpg\",\"id\":358}]','Explore our curated collection of abayas, designed for the modern woman who values tradition and sophistication. Each piece in our collection blends classic Middle Eastern designs with contemporary touches, offering a variety of styles perfect for any occasion. Crafted from premium fabrics, our abayas provide comfort and elegance, making them a staple in your wardrobe. Whether you’re looking for everyday wear or something special, WearSphere has the perfect abaya to complement your unique style.',NULL,'2024-08-20 17:58:49','2024-08-20 17:58:49',NULL),(16,'جلابيه','sneakers-spb-6bV','ar','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/361\\/conversions\\/cat-gal-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/361\\/cat-gal.png\",\"id\":361}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/362\\/conversions\\/banner-jalabya-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/362\\/banner-jalabya.jpg\",\"id\":362}]','استعرضي مجموعتنا من الجلابيات الأنيقة التي تم تصميمها لأولئك الذين يقدرون مزيج التراث مع الموضة المعاصرة. تم تصميم كل قطعة بعناية لتقديم الراحة والأناقة في كل مناسبة. سواء كانت للاستخدام اليومي أو المناسبات الخاصة، تجلب جلابياتنا الجمال في البساطة مع لمسة من التصميم العصري.',8,'2024-08-20 18:31:47','2024-08-23 17:47:44',NULL),(17,'Makhawir','watch-1SS','en','WomenDress','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/364\\/conversions\\/cat-makha-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/364\\/cat-makha.png\",\"id\":364}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/365\\/conversions\\/BANNER-MAKHAWIR-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/365\\/BANNER-MAKHAWIR.jpg\",\"id\":365}]','Explore our Makhawir collection, where tradition is blended with contemporary design. Each piece is crafted to reflect the rich heritage while embracing modern aesthetics. our Makhawir offer a unique fusion of comfort, style, and cultural elegance.',NULL,'2024-08-20 18:44:06','2024-08-22 09:23:56',NULL),(18,'رجال','رجال','ar','Shirts','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/370\\/conversions\\/cat-men-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/370\\/cat-men.png\",\"id\":370}]','[{\"thumbnail\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/371\\/conversions\\/banner-men-thumbnail.jpg\",\"original\":\"https:\\/\\/wearsphere.com\\/api\\/storage\\/371\\/banner-men.jpg\",\"id\":371}]','اكتشف مجموعتنا المختارة من ملابس الرجال المصممة بعناية لتلبية احتياجات الأناقة والراحة. تتضمن المجموعة تشكيلة متنوعة من الأزياء التي تجمع بين الكلاسيكية والعصرية لتناسب جميع المناسبات. سواء كنت تبحث عن أزياء يومية أو ملابس للمناسبات الخاصة، فإن تشكيلتنا توفر لك الخيارات المثالية لتعكس شخصيتك وأسلوبك الفريد.',NULL,'2024-08-20 21:38:32','2024-08-23 11:26:08',NULL);
