INSERT INTO `faqs` VALUES (1,1,NULL,'What is your return policy?','what-is-your-return-policy','We have a flexible return policy. If you\'re not satisfied with your purchase, you can return most items within 30 days for a full refund or exchange. Please review our Return Policy for more details.','global','Super Admin','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(2,1,NULL,'Can I track my order?','can-i-track-my-order','Yes, you can track your order\'s status. Once your order is shipped, you will receive a tracking number via email. You can use this tracking number to monitor the progress of your delivery.','global','Super Admin','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(3,1,NULL,'How long will it take to receive my order?','how-long-will-it-take-to-receive-my-order','Delivery times may vary depending on your location and the shipping method you choose. Typically, orders are processed and shipped within 1-2 business days. You can check the estimated delivery time during checkout.','global','Super Admin','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(4,1,NULL,'What payment methods do you accept?','what-payment-methods-do-you-accept','We accept a variety of payment methods, including credit cards (Visa, MasterCard, American Express), PayPal, and more. You can choose your preferred payment option during the checkout process.','global','Super Admin','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(5,1,NULL,'How can I place an order?','how-can-i-place-an-order','To place an order, simply browse our online store, add the items you want to your cart, and proceed to checkout. Follow the prompts to enter your shipping information and payment details to complete your purchase.','global','Super Admin','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(6,1,1,'What is the delivery process for furniture purchases?','what-is-the-delivery-process-for-furniture-purchases?','We offer convenient and reliable furniture delivery services. After making your purchase, our team will contact you to schedule a delivery time that suits your availability. Our delivery professionals will assemble and set up the furniture in your desired room. Please refer to our Delivery Information page for more details. ','shop','Blythe Knowles','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(7,1,1,'Do you provide warranty coverage for furniture items?','do-you-provide-warranty-coverage-for-furniture-items?','Yes, many of our furniture items come with manufacturer warranties that cover structural defects and craftsmanship issues. The duration and terms of the warranty may vary by product. You can find warranty information in the product descriptions, or you can contact our customer support team for specific details. ','shop','Blythe Knowles','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(8,1,2,'What is your return policy for clothing items?','what-is-your-return-policy-for-clothing-items?','We offer a hassle-free return policy for clothing purchases. If you are not completely satisfied with your clothing item, you can return it within 30 days of purchase, as long as the item is in its original condition with tags attached. For detailed information on our return process, please refer to our Returns and Exchanges page. ','shop','Urban Threads Emporium','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(9,1,2,'Do you offer plus-size or petite clothing options?','do-you-offer-plus-size-or-petite-clothing-options?','Yes, we strive to provide a diverse range of clothing sizes to accommodate all body types. Our inventory includes a selection of plus-size and petite clothing options in various styles and designs. You can use our size filters or contact our customer support for assistance in finding the perfect fit. ','shop','Urban Threads Emporium','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(10,1,11,'How can I determine the right size and style of bag for my needs when shopping online?','how-can-i-determine-the-right-size-and-style-of-bag-for-my-needs-when-shopping-online?','Finding the perfect bag online is made easier with our selection and helpful tools. Here\'s how to make an informed choice. Each bag product on our website includes detailed descriptions, including dimensions, capacity, and features. Read these descriptions carefully to understand the size and functionality of the bag. We provide high-quality images and, in some cases, videos that showcase the bag from different angles and show it in use. Visual aids can help you assess the bag\'s size and style better. Check out reviews and ratings from other customers who have purchased the same bag. Feedback from others who have used the bag for various purposes can provide valuable insights. We may offer size guides or charts to help you understand the bag\'s dimensions in relation to common items you might carry, such as laptops, books, or clothing. If you have specific questions or need personalized recommendations, our customer support team is here to assist you. Use our live chat feature or contact us via email or phone for expert guidance. Rest assured that we have a flexible returns and exchanges policy. If the bag doesn\'t meet your expectations, you can usually return or exchange it within a specified time frame.  ','shop','Marny Rose','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(11,1,11,'What measures do you take to ensure the quality and durability of the bags you sell online?','what-measures-do-you-take-to-ensure-the-quality-and-durability-of-the-bags-you-sell-online?','We are committed to providing high-quality and durable bags to our customers. Here\'s how we ensure the quality and durability of the bags in our online shop. We carefully curate our collection from reputable brands known for their craftsmanship and quality. We partner with brands that have a strong track record in producing durable and long-lasting bags. Each bag product listing includes detailed information about the materials used in its construction. This allows you to assess the bag\'s durability and suitability for your needs. Many of our bags come with manufacturer warranties that cover defects in materials and workmanship. Check the product listing for warranty details. We value customer feedback and consider it when selecting bags for our inventory. Positive reviews and high ratings from satisfied customers are indicative of product quality. In the rare event that you receive a bag with defects or quality issues, our returns and exchanges policy allows you to return or exchange the product for your peace of mind. ','shop','Marny Rose','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(12,1,4,'How can I find the right makeup products for my skin tone and type when shopping online?','how-can-i-find-the-right-makeup-products-for-my-skin-tone-and-type-when-shopping-online?','Shopping for makeup online is made easier with our website\'s tools and resources to help you find the perfect products for your skin. Here\'s how to get started. Each makeup product on our website includes detailed descriptions, including shade names, undertones, and ingredients. Read these descriptions carefully to find products that match your skin tone and type. We offer shade matching tools and guides for foundations, concealers, and other complexion products. These tools can help you identify your ideal shade based on your skin undertones. Check out product reviews and ratings left by other customers who have similar skin tones or concerns. Their feedback can provide valuable insights into how a product performs. If you\'re unsure about a product or need personalized recommendations, our customer support team is here to assist you. Use our live chat or contact us via email or phone for expert guidance.  We may offer sample sizes or testers for select products. Trying out samples can be a great way to test shades and formulas before committing to a full-sized product. Rest assured that we have a flexible returns and exchanges policy. If a product doesn\'t meet your expectations, you can usually return or exchange it within a specified time frame.','shop','Boho Bliss Emporium','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(13,1,4,'How do I ensure the authenticity and quality of the makeup products purchased online?','how-do-i-ensure-the-authenticity-and-quality-of-the-makeup-products-purchased-online?','We prioritize the authenticity and quality of all our makeup products to ensure a positive shopping experience. Here\'s how we guarantee the authenticity and quality of our products. We are an authorized retailer for all the brands and products we carry. This means that we source our products directly from reputable manufacturers and distributors. Makeup products are delivered in their original, sealed packaging. We do not sell opened or tampered products. We only carry well-known and trusted makeup brands with a proven track record for quality and safety. Each product listing on our website includes detailed information, including brand, ingredients, and usage instructions, to help you make an informed decision. We value customer feedback and take it into account when selecting products for our inventory. Positive reviews and high ratings from satisfied customers are indicative of product quality.  In the unlikely event that you receive a product that doesn\'t meet your expectations, our flexible returns and exchanges policy allows you to return or exchange it for your peace of mind. ','shop','Boho Bliss Emporium','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(14,1,5,'How do I place an order for bakery products on your website?','how-do-i-place-an-order-for-bakery-products-on-your-website?','Ordering delicious bakery products from our online shop is easy and convenient. Here\'s a step-by-step guide to placing an order: Visit our website to explore our mouthwatering range of bakery products. You can browse by category, including bread, pastries, cakes, and more. Click on the items you\'d like to purchase to view detailed descriptions, prices, and available options (e.g., flavors, sizes, and quantities). Add your desired products to your virtual shopping cart.  Before proceeding to checkout, review the items in your cart to ensure you\'ve selected everything you want. You can make adjustments, update quantities, or remove items as needed. When you\'re ready to complete your order, proceed to the checkout page. Here, you\'ll provide your delivery information and select your preferred delivery date and time slot. Choose your preferred payment method, such as credit/debit card or digital wallet, and securely enter your payment details. After successful payment, you\'ll receive an order confirmation via email or SMS. This confirmation will include the details of your order, delivery date, and a unique order number. On the scheduled delivery date, our team will carefully prepare your bakery items and deliver them to your doorstep. You\'ll receive a notification when your order is on its way. Once your delicious bakery treats arrive, simply unpack and enjoy your freshly baked goodies. ','shop','Sleek Streetwear Co.','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(15,1,5,'Do you accommodate special dietary needs or allergies?','do-you-accommodate-special-dietary-needs-or-allergies?','Yes, we strive to accommodate various dietary needs and allergies to ensure that everyone can enjoy our bakery products. Here\'s how we address specific dietary requirements: Each product on our website includes detailed information about allergens, such as nuts, dairy, eggs, and gluten. You can check these allergen labels to make informed choices. We offer a selection of products tailored to specific dietary preferences and restrictions. This may include gluten-free, vegan, or sugar-free options. You can easily filter products by dietary category on our website to find suitable choices. In some cases, we may be able to customize certain products to meet your specific dietary needs. If you have a special request or dietary requirement, please reach out to our customer support team, and we\'ll do our best to assist you. ','shop','Sleek Streetwear Co.','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(16,1,6,'How does the online ordering and delivery process work?','how-does-the-online-ordering-and-delivery-process-work?','Ordering groceries online with us is simple and convenient. Here\'s a step-by-step guide to our process:  Visit our website or mobile app to browse our wide selection of groceries. You can search for specific items or explore categories. Add the products you need to your virtual shopping cart.  Before checkout, review your cart to ensure you have everything you need. You can also customize your order, specify quantities, and make any necessary adjustments.  Proceed to the checkout page to review your order one last time. You can choose your preferred payment method, including credit/debit cards or digital wallets, and complete the transaction securely. Select your preferred delivery time slot. We offer flexible delivery options to accommodate your schedule. Once your order is placed, you will receive an order confirmation via email or SMS. You can track the status of your order through your account. Our dedicated delivery team will carefully pack your groceries and deliver them to your doorstep at the chosen time. You\'ll receive a notification when your order is out for delivery.  Receive your groceries, unpack, and enjoy your fresh and quality products. ','shop','Ethereal Essence Boutique','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(17,1,6,'What are the delivery fees and minimum order requirements?','what-are-the-delivery-fees-and-minimum-order-requirements?','We aim to provide affordable and convenient online grocery shopping. Our delivery fees and minimum order requirements are as follows: The delivery fee may vary depending on your location and the time slot you choose. We strive to keep our delivery charges competitive and transparent. You can view the applicable fees during the checkout process. To place an order for delivery, we have a minimum order requirement. This requirement helps us cover the costs associated with packing and delivering your groceries. The minimum order amount may vary based on your location, but you can easily check the specific minimum for your area on our website or app. Please note that we may offer promotions and discounts from time to time, including waived delivery fees for orders over a certain amount. Keep an eye out for these special offers to save even more on your online grocery shopping. ','shop','Ethereal Essence Boutique','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(18,1,7,'Can I order both physical books and e-books from your store?','can-i-order-both-physical-books-and-e-books-from-your-store?','Yes, you can choose from a wide selection of physical books and e-books in our store. Simply browse our catalog and select your preferred format for each title. Physical books will be delivered to your address, while e-books can be downloaded instantly upon purchase.','shop','Xena Ochoa','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(19,1,7,'Do you offer book recommendations or have a book club?','do-you-offer-book-recommendations-or-have-a-book-club?','We love books, and we\'re here to help you discover new reads! You can explore our Recommended Reads section for curated book recommendations. Additionally, we periodically host virtual book club events where readers can discuss and explore books together. Stay tuned for announcements on our website or social media.','shop','Xena Ochoa','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(20,1,8,'Do you provide warranty coverage for electronic gadgets?','do-you-provide-warranty-coverage-for-electronic-gadgets?','Yes, most electronic gadgets come with manufacturer warranties that cover defects and malfunctions. The warranty duration and terms vary by product and brand. You can find warranty information in the product descriptions or contact our customer support for specific details.','shop','Lavinia Burch','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(21,1,8,'Are your gadgets brand new, or do you offer refurbished options as well?','are-your-gadgets-brand-new,-or-do-you-offer-refurbished-options-as-well?','We primarily offer brand new gadgets, but we may occasionally have certified refurbished options available. Each product listing will specify whether it is new or refurbished. Refurbished gadgets undergo thorough testing and quality checks to ensure they meet high standards. ','shop','Lavinia Burch','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(22,1,9,'Can I order prescription medications from your online medicine shop?','can-i-order-prescription-medications-from-your-online-medicine-shop?','We do not offer prescription medications. Our shop specializes in over-the-counter (OTC) and wellness products. Please consult a healthcare professional for prescription medications and guidance. ','shop','Claire Miranda','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(23,1,9,'What measures do you take to ensure the authenticity and safety of the medicines you sell?','what-measures-do-you-take-to-ensure-the-authenticity-and-safety-of-the-medicines-you-sell?','We work exclusively with trusted suppliers and brands to ensure the authenticity and safety of the medicines and wellness products in our inventory. All products are sourced from licensed manufacturers and adhere to strict quality and safety standards. ','shop','Claire Miranda','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(24,1,10,'Can I return baby care items if they are unopened and unused?','can-i-return-baby-care-items-if-they-are-unopened-and-unused?','Yes, you can return unopened and unused baby care items within 30 days of purchase. We prioritize the safety and satisfaction of our customers, and our return policy reflects that commitment.','shop','Drake Cain','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46'),(25,1,10,'Are your baby care products free from harmful chemicals and safe for infants?','are-your-baby-care-products-free-from-harmful-chemicals-and-safe-for-infants?','Absolutely. We source baby care products from reputable brands known for their commitment to safety and quality. All our products comply with safety standards and are free from harmful chemicals. You can find detailed ingredient information on product labels and descriptions. ','shop','Drake Cain','en',NULL,'2024-06-29 01:55:46','2024-06-29 01:55:46');
