INSERT INTO `products` VALUES (3,'Levi Blue top','levi-blue-top','Fendi began life in 1925 as a fur and leather speciality store in Rome. Despite growing into one of the world’s most renowned luxury labels, the business has retained its family feel, with a focus on fine detail, Italian craftsmanship and the support of local artisans.',16,NULL,2,NULL,'ar',180.00,600.00,NULL,3500,0,1,0,0,NULL,'draft','variable','1 pc',NULL,NULL,NULL,'{\"id\": 97, \"original\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/97/A-2.png\", \"thumbnail\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/97/conversions/A-2-thumbnail.jpg\"}',NULL,'[{\"id\": 99, \"original\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/99/A-1.png\", \"thumbnail\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/99/conversions/A-1-thumbnail.jpg\"}, {\"id\": 100, \"original\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/100/A-2.png\", \"thumbnail\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/100/conversions/A-2-thumbnail.jpg\"}, {\"id\": 106, \"original\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/106/A-3.png\", \"thumbnail\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/106/conversions/A-3-thumbnail.jpg\"}]',NULL,'2021-10-10 14:57:17','2024-08-20 17:16:30',NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL),(22,'Funder Armor Yellow Tops','funder-armor-yellow-tops','Fendi began life in 1925 as a fur and leather speciality store in Rome. Despite growing into one of the world’s most renowned luxury labels, the business has retained its family feel, with a focus on fine detail, Italian craftsmanship and the support of local artisans.',16,NULL,7,NULL,'ar',30.00,35.00,NULL,1500,0,1,0,0,NULL,'draft','variable','1 pcs',NULL,NULL,NULL,'{\"id\": 173, \"original\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/173/C.png\", \"thumbnail\": \"https://chawkbazarlaravel.s3.ap-southeast-1.amazonaws.com/