INSERT INTO `refund_policies` VALUES (1,'Vendor Return Policy','vendor-return-policy','Our vendor return policy ensures that you can return products within 30 days of purchase if they are damaged or not as described.','vendor','en','approved',1,'2024-06-29 01:55:46',NULL,NULL),(2,'Customer Return Policy','customer-return-policy','Our customer return policy allows you to return products within 14 days of purchase for a full refund, no questions asked.','customer','en','approved',2,'2024-06-29 01:55:46',NULL,NULL),(3,'Electronics Return Policy','electronics-return-policy','For electronics, our return policy extends to 60 days. We stand by the quality of our electronic products.','customer','en','approved',1,'2024-06-29 01:55:46',NULL,NULL),(4,'Furniture Return Policy','furniture-return-policy','Our furniture return policy allows you to return furniture within 7 days if it doesn\'t meet your expectations. Customer satisfaction is our priority.','customer','en','approved',1,'2024-06-29 01:55:46',NULL,NULL),(5,'Custom Orders Policy','custom-orders-policy','Please note that custom orders are not eligible for returns or refunds. We craft custom items to your specifications.','customer','en','approved',2,'2024-06-29 01:55:46',NULL,NULL),(6,'Rückgabebedingungen des Anbieters','rückgabebedingungen-des-anbieters','Unsere Rückgaberichtlinie des Anbieters stellt sicher, dass Sie Produkte innerhalb von 30 Tagen nach dem Kauf zurückgeben können, wenn sie beschädigt sind oder nicht der Beschreibung entsprechen.','vendor','de','approved',1,'2024-06-29 01:55:46',NULL,NULL),(7,'Rückgabebedingungen für Kunden','rückgabebedingungen-für-kunden','Unsere Rückgaberichtlinie für Kunden ermöglicht es Ihnen, Produkte innerhalb von 14 Tagen nach dem Kauf gegen eine vollständige Rückerstattung zurückzugeben, ohne dass Fragen gestellt werden.','customer','de','approved',2,'2024-06-29 01:55:46',NULL,NULL),(8,'Rückgabebedingungen für Elektronik','rückgabebedingungen-für-elektronik','Für Elektronik gilt eine Rückgabefrist von 60 Tagen. Wir stehen für die Qualität unserer elektronischen Produkte.','customer','de','approved',3,'2024-06-29 01:55:46',NULL,NULL),(9,'Rückgabebedingungen für Möbel','rückgabebedingungen-für-möbel','Unsere Rückgaberichtlinie für Möbel ermöglicht es Ihnen, Möbel innerhalb von 7 Tagen zurückzugeben, wenn sie nicht Ihren Erwartungen entsprechen. Kundenzufriedenheit ist unsere Priorität.','customer','de','approved',4,'2024-06-29 01:55:46',NULL,NULL),(10,'Richtlinien für Sonderanfertigungen','richtlinien-für-sonderanfertigungen','Bitte beachten Sie, dass Sonderanfertigungen von der Rückgabe oder Rückerstattung ausgeschlossen sind. Wir fertigen maßgeschneiderte Artikel nach Ihren Vorgaben.','customer','de','approved',5,'2024-06-29 01:55:46',NULL,NULL);
/*!40000 ALTER TABLE `refund_policies` ENABLE KEYS */;
