et nicht für direkte, indirekte, zufällige, besondere, Folge- oder Strafschäden, die sich aus der Nutzung oder Unmöglichkeit der Nutzung der Website ergeben.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(7,1,NULL,'Geistiges Eigentum','geistiges-eigentum','Die Website und ihre ursprünglichen Inhalte, Merkmale und Funktionen sind Eigentum von [Ihrem Unternehmen] und durch internationale Urheber-, Marken- und andere Gesetze zum Schutz des geistigen Eigentums geschützt.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(8,1,NULL,'Datenschutzrichtlinie','datenschutzrichtlinie','Ihre Nutzung der Website unterliegt außerdem unserer Datenschutzrichtlinie, die Sie unter [Link zur Datenschutzrichtlinie] finden. Durch die Nutzung der Website stimmen Sie den in der Datenschutzrichtlinie beschriebenen Praktiken zu.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(9,1,NULL,'Nutzung der Website','nutzung-der-website','Sie müssen mindestens [Alter] Jahre alt sein, um diese Website nutzen zu können. Durch die Nutzung der Website erklären und garantieren Sie, dass Sie mindestens [Alter] Jahre alt sind. Sie erklären sich damit einverstanden, die Website nur für rechtmäßige Zwecke und in einer Weise zu nutzen, die nicht die Rechte anderer verletzt.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL),(10,1,NULL,'Annahme der Bedingungen','annahme-der-bedingungen','Durch die Nutzung dieser Website erklären Sie sich damit einverstanden, diese Allgemeinen Geschäftsbedingungen einzuhalten und an sie gebunden zu sein. Wenn Sie diesen Bedingungen nicht zustimmen, nutzen Sie die Website bitte nicht.','global','Super Admin',1,'de',NULL,'2024-06-29 01:55:46',NULL);
